import React from 'react';
class Footer extends React.Component{
    render(){
        return(
            <div className="footer">
                <div>Contact us</div>
                <div>About us</div>      
                <div>Privacy policy</div>
                <div>Locate us on a map</div>
            </div>
        )
    }
}
export default Footer;
